{
  "judgement": "sí",
  "continuation": "y en una noche tempestuosa de la mar,  
picó con un bajel de Inglaterra,  
que de corsario iba por la mar salada;  
¡Oh, qué de dineros hurtó al inglés  
y cuántas ricas joyas y perlas finas!  
Por esto fue Maese Campuzano  
conocido en las Indias y en España."
}
